import React from "react";


class Student extends React.Component{
    constructor(props){
        super(props)

    }

    render(){
        return <div>
            <ul>
                <li>Home</li>
                <li>MentorS</li>
                <li>Opportunities</li>
                <li>Event</li>
            </ul>
        </div>
    }
}
 

export default Student
